import React from 'react';
import {BrowserRoute, Route, Switch} from 'react-router-dom';
import {Home} from '../src/core/Home';

const Routes = () => {
    return (
        <BrowserRoute>
            <Route path="/" exact component={Home} />
        </BrowserRoute>
    );
}

export default Routes;
